/* Questo Ã¨ un commento CSS */
/* Selezioniamo tutti i paragrafi nel documento HTML */
p {
    /* Impostiamo il colore del testo su blu */
    color: blue;
    /* Impostiamo il font su Arial, con fallback a sans-serif nel caso in cui Arial non sia disponibile */
    font-family: Arial, sans-serif;
    /* Impostiamo la dimensione del carattere a 16 pixel */
    font-size: 16px;
    /* Impostiamo il margine superiore e inferiore a 10 pixel e i margini laterali a 0 */
    margin: 10px 0;
    /* Impostiamo il padding a 5 pixel tutti intorno al paragrafo */
    padding: 5px;
    /* Impostiamo lo sfondo del paragrafo su un colore grigio chiaro */
    background-color: lightgray;
    /* Impostiamo il bordo del paragrafo su 1 pixel solid nero */
    border: 1px solid black;
}
